import { ChatAlt2Icon } from "@heroicons/react/solid";
import React from "react";

export default function Navbar() {
  return (
    // <header className="bg-g-light md:sticky top-0 z-10">
    //   <div className="container mx-auto flex flex-wrap p-5 flex-col md:flex-row items-center">
    //     <a href="#" className="ml-3 text-xl font-rock-salt title-font font-medium text-white mb-4 md:mb-0">
    //       Musa Ahmed
    //     </a>
    //     <hr className="w-1/12 h-0.5 -mt-2.5 mb-2 bg-yellow-500 border-none lg:hidden sm:hidden"></hr>
    //     <nav className="text-white font-dm-sans sm:text-lg md:text-xl lg:text-2xl md:mr-auto md:ml-4 md:py-1 md:pl-4 md:border-l-2 md:border-yellow-500 flex flex-wrap items-center justify-center">
    //       <a href="#projects" className="mr-5 hover:text-white">
    //         Past Work
    //       </a>
    //       <a href="#skills" className="mr-5 hover:text-white">
    //         Skills
    //       </a>
    //       <a href="#testimonials" className="mr-5 hover:text-white">
    //         Testimonials
    //       </a>
    //     </nav>
    //     <a
    //       href="#contact"
    //       className="text-green-400 inline-flex items-center bg-gray-800 border-0 py-1 px-3 focus:outline-none hover:bg-gray-700 rounded text-base mt-4 md:mt-0">
    //       Contact Me
    //       <ChatAlt2Icon className="w-4 h-4 ml-1" />
    //     </a>
    //   </div>
    // </header>

		<nav class="bg-white shadow-lg">
			<div class="max-w-6xl mx-auto px-4">
				<div class="flex justify-between">
					<div class="flex space-x-7">
						<div>

							<a href="#" class="flex items-center py-4 px-2">
								<img src="logo.png" alt="Logo" class="h-8 w-8 mr-2" />
								<span class="font-semibold text-gray-500 text-lg">Navigation</span>
							</a>
						</div>

						<div class="hidden md:flex items-center space-x-1">
							<a href="" class="py-4 px-2 text-green-500 border-b-4 border-green-500 font-semibold ">Home</a>
							<a href="" class="py-4 px-2 text-gray-500 font-semibold hover:text-green-500 transition duration-300">Services</a>
							<a href="" class="py-4 px-2 text-gray-500 font-semibold hover:text-green-500 transition duration-300">About</a>
							<a href="" class="py-4 px-2 text-gray-500 font-semibold hover:text-green-500 transition duration-300">Contact Us</a>
						</div>
					</div>

					<div class="hidden md:flex items-center space-x-3 ">
						<a href="" class="py-2 px-2 font-medium text-gray-500 rounded hover:bg-green-500 hover:text-white transition duration-300">Log In</a>
						<a href="" class="py-2 px-2 font-medium text-white bg-green-500 rounded hover:bg-green-400 transition duration-300">Sign Up</a>
					</div>

					<div class="md:hidden flex items-center">
						<button class="outline-none mobile-menu-button">
						<svg class=" w-6 h-6 text-gray-500 hover:text-green-500 "
							x-show="!showMenu"
							fill="none"
							stroke-linecap="round"
							stroke-linejoin="round"
							stroke-width="2"
							viewBox="0 0 24 24"
							stroke="currentColor"
						>
							<path d="M4 6h16M4 12h16M4 18h16"></path>
						</svg>
					</button>
					</div>
				</div>
			</div>

			<div class="hidden mobile-menu">
				<ul class="">
					<li class="active"><a href="index.html" class="block text-sm px-2 py-4 text-white bg-green-500 font-semibold">Home</a></li>
					<li><a href="#services" class="block text-sm px-2 py-4 hover:bg-green-500 transition duration-300">Services</a></li>
					<li><a href="#about" class="block text-sm px-2 py-4 hover:bg-green-500 transition duration-300">About</a></li>
					<li><a href="#contact" class="block text-sm px-2 py-4 hover:bg-green-500 transition duration-300">Contact Us</a></li>
				</ul>
			</div>
		</nav>

  );
}
